import FreeAppItem from "./FreeAppItem.css";
const FreeAppList = (props) => {
  return (
    <ul>
      {" "}
      {props.item.map((app) => (
        <FreeAppItem
          key={app.id}
          label={app.label}
          category={app.category}
          date={app.date}
        />
      ))}
    </ul>
  );
};

export default FreeAppList;
